import React from "react";
import Item from "./Item";

const ListItem = (props) => {
  return (
    <div className="list-it">
        {props.items.map((item) => ( 
          <Item
            key={item.id}
            title={item.title}
          />
          ))}
    </div>
  );
};

export default ListItem;
